-- ----------------------------
--  Table structure for `jurisdicciones`
-- ----------------------------
DROP TABLE IF EXISTS `jurisdicciones`;
CREATE TABLE `jurisdicciones` (
	`no_jur` int(11) NOT NULL AUTO_INCREMENT,
	`des_jur` varchar(60) DEFAULT NULL,
	`campo_1` longtext DEFAULT NULL,
	`campo_2` varchar(10) DEFAULT '',
	`campo_3` varchar(10) DEFAULT '',
	`campo_4` varchar(100) DEFAULT '',
	`campo_5` varchar(120) DEFAULT '',
	`campo_6` varchar(100) DEFAULT '',
	`campo_7` varchar(255) DEFAULT '',
	`campo_8` varchar(80) DEFAULT '',
	`campo_9` longtext DEFAULT NULL,
	`campo_10` varchar(50) DEFAULT '',
	`campo_11` varchar(50) DEFAULT '',
	`campo_12` varchar(50) DEFAULT '',
	`campo_13` text DEFAULT NULL,
	`campo_14` text DEFAULT NULL,
	`campo_15` varchar(30) DEFAULT '',
	`campo_16` longtext DEFAULT NULL,
	`campo_17` longtext DEFAULT NULL,
	`mapa` text DEFAULT NULL,
	PRIMARY KEY (`no_jur`)
) ENGINE=`InnoDB` AUTO_INCREMENT=5 DEFAULT CHARACTER SET latin1 COLLATE latin1_swedish_ci ROW_FORMAT=COMPACT COMMENT='' CHECKSUM=0 DELAY_KEY_WRITE=0;

