BEGIN;
INSERT INTO `jurisdicciones` VALUES ('1', 'J.S. 1 MEXICALI', 'La Jurisdicción 1 Mexicali no cuenta con almacén propio, se surte directamente del Almacén Estatal, el cual en la localidad del Ejido Puebla , a un costado del CS Ejido Puebla.\r\nNos atendió el Lic. Humberto Argaez - Jefe de Almacén, quien tiene 2 meses que se integro al almacén.\r\n', '8:00', '17:00', '2,500 m2 almacén (estimado) y 600 m2 almacén secundario', '15 personas', '5 camioneta 5 toneladas, 2 camionetas 3 ½ toneladas y 2 camionetas 1 tonelada', '5 equipos de cómputo', 'SIAL (Sistema de Almacenes) y Excel', 'El almacén cuenta con un almacén propio en Ejido Puebla y tienen uno secundario en donde se encuentran las oficinas de la Secretaría de Salud, en donde no tiene personal asignado, es decir, en caso de requerir algún insumo de este almacén el personal que esta en Ejido se tiene que trasladar y dejar las tareas que estuvieran realizando.', 'Varios', '299 claves', '188 claves', 'Marzo 2014', 'El almacén estatal se encarga de abastecer a los Hospitales y las Unidades Medicas de la Jurisdicción Mexicali (incluye Caravanas).\r\n* Hospitales: Estos le mandan su solicitud de manera semanal o cada que necesiten un insumo para que el almacén les prepare el paquete y dependiendo de la urgencia, lo distribuye el almacén o lo recoge el Hospital.\r\n* Jurisdicción: Las unidades envían su pedido al responsable de abasto de la JS para su analisis, este envía los pedidos al Jefe de Almacén para su elaboración de paquetes y su distribución correspondiente, esto conforme a un calendario. Las caravanas y alguna unidad que se encuentre cerrada tiene que ir a recoger su paquete directamente al almacén.\r\nEn algunos casos se apoya a las demás Jurisdicciones con insumos o viceversa.', 'Mensual', 'La distribución se realiza conforme a calendario mensual con fechas específicas de Recepción de Pedidos Almacén (RA), Surtir por Parte de Almacén (SU), Recepción Jurisdicción (RJ) y Entrega de Material (E), Este calendario lo determina el Responsable de Abasto de la Jurisdicción y el Jefe de Almacén Estatal.\r\nDe acuerdo a los volúmenes es el tipo de unidad que utilizan.\r\nLas caravanas por tener vehículo propio recogen su paquete en el almacén.', 'El jefe de almacén tiene dos meses que ingreso al almacén.\r\nNo cuentan con un inventario confiable, la última vez que realizaron inventario fue en Diciembre 2013 pero no se cargo y hubo malos manejos, por lo que van a volver a realizar el inventario para cargarlo en el SIAL pero van a contratar a una empresa para que se los realice (no saben el nombre de la empresa).\r\nSe cuenta con 6 cámaras frías: 3 cámaras de 4x6 y 3 cámaras de 2x2 de las cuales 2 no funcionan, se pretende quitar dos cámaras chicas para hacer una más amplia.\r\nEl almacén cuenta con aire acondicionado y cuando hace mucho calor permanece encendido las 24 hrs.\r\nCuenta con sistema de cámaras de vigilancia y alarma que fueron instaladas en Febrero 2014.\r\nNo tiene conocimiento de cuantos proveedores van a recibir al día.\r\nTienen un procedimiento de documentación para recibir al proveedor.\r\nManejan tres sistemas: Sistema de Presupuesto, Sistema de Almacenes y Sistema de Licitaciones pero tienen accesos restringidos.\r\nResguardan las vacunas del Estado.\r\n\r\n', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3360.3146226223057!2d-115.44018399999999!3d32.62444399999995!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x80d770ef22f239db%3A0xbca38640a13f11d8!2sJSS1!5e0!3m2!1ses!2s!4v1398697677820'), ('2', 'J.S. 2 TIJUANA', 'El almacén se encuentra en la Calle San Antonio de los Buenos 8540-A Parque Industrial Valle Sur II CP 22537, se tuvo la entrevista con el Lic. Juan Manuel Ramírez Gutierrez quien funge el puesto de Coordinador de Almacén.', '8:00', '17:00', '1700 m2', '9', '4', 'si', 'si', 'El almacén se encuentra en Polígono Industrial, es rentado, cuentan con un patio de maniobras amplio con andenes de carga y descarga. Cuenta con cuarto de controlados más no con licencia sanitaria, la red fría es a base de dos refrigeradores que no están conectados a ninguna planta de emergencia. Se tiene un Sistema de Almacén llamado SIC, no genera reportes, solo genera reportes de entradas y salidas.', 'Recursos Materiales, Secretaría de Salud', '180', '60', '01/04/2014, surtió parcialidades del requerimiento', 'Recursos materiales/coordinación de abasto estatal realiza las compras a los distintos laboratorios, esto en base al plan de abasto anual que realiza el área médica, sin embargo nunca ha sido suficiente debido a que el consumo promedio mensual por unidad de atención es más alto. Actualmente se encuentra con el 60% de medicamento y 20% de material de curación. Tienen mucha dificultad al recepcionar debido a que nadie les avisa cuando llegará y tienen poco personal. Por ejemplo, se solicitiaron 700,000 piezas y solamente se surtieron 200,000', 'Mensual', 'No cuentan con los vehículos y personal suficiente para la realización y entrega de paquetes por lo que en ocasiones sus visitas pueden ser aleatorias e incluso postergar la entrega. Cuentan con 4 vehículos (uno descompuesto) y 5 personas en piso', 'El Lic. Ramírez tiene 7 años en dicho almacén y está consciente que no cuenta con el apoyo y recurso necesario para llevar a cabo una buena planeación de rutas, incluso en ocasiones los propios Médicos responsables de la Unidad de atención acuden al almacén por su insumo. Han elaborado planes de acción como avanzada, \"carrito bimbo\", microred y otros, pero el problema sigue sin solucionarse; desabasto, información, controles, herramientas de trabajo y recursos.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3366.3682980417266!2d-116.90981279999998!3d32.46283949999999!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x80d9393ebf4ab171%3A0x7f2f31fdcc041727!2sAv+de+los+Insurgentes!5e0!3m2!1ses!2s!4v1398350303470'), ('3', 'J.S. 3 ENSENADA', 'Me presente con el Jefe jurisdiccional Dr. Hector Adrian Trejo Dozal, quien dio la orden a su personal de que me facilitaran toda la información necesaria. De ahí le solicito al personal que informara al personal del almacén para que me brindaran la información del almacén. ', '8:00', '15:30', '700 mts2 ', '213', '68', '205', 'windows', 'El almacén donde reciben los medicamentos también atiende la Jurisdicción 4, y se encuentra localizado en Valle Dorado, y los insumos de oficina se manejan en el almacén que esta en la jurisdicción.\r\nen total en la jurisdicción + unidades tiene 683 personas trabajando. El dato del equipo de computo no se conoce pero comentan que todo el personal tiene equipo de computo a ecepción del personal de seguridad. El almacén trabaja con un horario de 08:00 a 17:00.', 'Almacen de Mexicali y proveedores distintos', '207', 'No esta definido actualmente', '23/abril/2014', 'Principalmente Mexicali es quien compra todo el insumo y es quien lo distribuye a los demás almacenes. los pedidos se generan desde Mexicali y se reciben tanto a los proveedores directamente y/o desde el almacén de Mexicalli. ', 'mensual y quincenal', 'los centros de salud  se visitan 1 vez al mes y los CAAPS cada 15 días. Los pedidos de emergencia se trata de surtir el mismo día que se recibe el requerimiento en el almacén considerando las entregas programadas del día. Los paquetes se hacen vía un requerimiento electrónico y los urgentes vía una solicitud de abasto.', 'Se acaba de contratar a un personal para el tema de abasto, él cual esta encargado de todo el abasto en la jurisdicción. De igual manera es la persona que esta implementando un sistema de captura en las unidades urbanas para el control del insumo. El almacén se encuentra al otro lado de la ciudad en la salida hacía Vicente Guerrero, cerca del hospital general.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3388.107140638983!2d-116.62106999999993!3d31.876503299999936!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x80d89288b732a027%3A0x58441b4bb02873da!2sRuiz+1340!5e0!3m2!1ses!2s!4v1398697793580'), ('4', 'J.S. 4 VICENTE GUERRERO', 'Nos entrevistamos con Victor Manuel Guevara Ventura, (Encargado de recursos materiales y Coordinador de servicios generales). Se le informo del censo que se está haciendo y que el fin de este era para ver el estatus de las unidades en relación al abasto y de como es que se realiza en la Jurisdicción 4 \"Vicente Guerrero\". Nos informo que el jefe jurisdiccional no se encuentra debido a que salio a una reunión. El nombre de la jefa jurisdiccional es Dra. María Del Consuelo Monroy Ibarra.\r\nNos explico como llevan a cabo el abasto de las unidades, así como también como realizan los requerimientos al almacén de Ensenada, ya que ellos no solicitan el insumo al almacén estatal. Todo lo ven a través del almacén de Ensenada.', '7:00', '15:30', '50X40= 200mts.', '22', '38', '22', 'Sistema operativo Windows', 'El área dada es del terreno donde están las oficinas y el almacén tomando en cuenta el área de estacionamiento. El área destinada al almacenaje es de aprox. 8X10=80mts. en forma de \"L\". Cuentan con impresoras y 1 copiadora. Cuentan con una planta de generación de luz para abastecer el área de oficinas y la cámara de red fría.', 'Almacén de Ensenada', '145', '170', '24/ABRIL/2014', 'El almacén manda sus unidades al almacén de Ensenada para abastecerse. No se tienen compras directas. Se visita el almacén de Ensenada 1 vez al mes. Aún cunado tienen autorizado un catálogo mayor de claves solo consumen las claves mencionadas anteriormente. El requerimiento se lo solicitan al almacén de ensenada y ya en el caso de que este no las tenga se solicita al almacén estatal apoyo para que se entreguen los insumos en el almacén de Ensenada. Manejan un 70% de abasto en Mat. Curación y 85% en medicamento.', 'Quincenal', 'Se visita de manera quincenal, Una semana si y la siguiente semana no se visita. El abasto es de manera a granel, se carga la unidad vehicular con todo el insumo y se visitan las unidades y abastecen según lo que les pida la unidad en el momento de su visita. Lo que se carga en la unidad es en base a un plan de abasto, el cual toma en cuenta el consumo promedio de las unidades que manejan. Una vez se encuentra la unidad en el Centro de Salud se llena un formato con el insumo que se deja. Así mismo se hace recolección de las claves que se encuentran en sobre abasto y se redistribuye a otras unidades.', 'El administrador es el mismo que el del CAAPS Vicente Guerrero. Desde el almacén se administran las caravanas y el mismo CAAPS Vicente Guerrero. Actualmente se tiene bajo resguardo los equipos de computo para el expediente electrónico de las distintas unidades.Se observa que el área destinada al almacenaje es muy limitada. En el refrigerador utilizado para las insulinas se observa que también tiene refrescos, aguas y alimentos. Cuentan con servicio de Internet. No cuentan con un sistema de control de inventario. Se hacen inventario 1 vez al mes en papel y se queda para consulta del personal del almacén. Utilizan una casa de un pasante para guardar insumo cuando no cabe en el almacén (en la cochera de la casa).', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3429.5702104213888!2d-115.99433150000002!3d30.73048079999997!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x81263fab2c7004a3%3A0x8bd2f8032d62c495!2sVicente+Guerrero!5e0!3m2!1ses!2s!4v1398454055253');
COMMIT;

