-- ----------------------------
BEGIN;
INSERT INTO `tb_entrevista_juris` VALUES ('1', 'J.S. 1 MEXICALI', 'ENTREVISTA DEL 23/04/14 CON EL DR. SERGIO TOLENTO, JEFE DE LA JURISDICCIÓN I\r\n\r\n* El Dr. Tolento se comunicó con oficinas centrales para corroborar la emisión del oficio ya que no había sido informado.\r\n* La JS está conformada por 40 unidades y 11 caravanas móviles.\r\n* La JS I no cuenta con su propio almacén, ya que se siempre se ha surtido directamente del almacén estatal. Los pedidos se realizan mensualmente en base a requerimientos que las unidades comunican a la JS. El almacén estatal elabora los paquetes y realiza la distribución a todas las unidades. En algunos casos las unidades médicas recogen su paquete en el almacén estatal, pero no es lo común.\r\n* La JS cuenta con su propio parque vehicular del que se apoyan para la distribución.\r\n* Lo que aquí se conoce como CAAPS equivale a un Hospital Comunitario. Hay unidades denominadas gerencias que tienen a su cargo (supervisan) unidades menores a su alrededor. Estas gerencias tienen un catálogo más amplio.\r\n* Los CAAPS de la JS I son tres: Cd. Morelos, Guadalupe Victoria (Km. 43) y San Felipe. Menciona que los hospitales pertenecen a la JS pero en realidad son independientes y dependen de la Subsecretaría.\r\n* Nos refirió con área médica para que nos autorizaran acceso a las unidades.\r\n\r\n\r\nENTREVISTA DEL 25/04/14 CON VÍCTOR MANUEL ORANTES VEGA, RESPONSABLE DE ABASTO DE LA JURISDICCIÓN I - MEXICALI\r\n\r\n* La JS no cuenta con almacén propio por lo que se surte y distribuye del almacén estatal.\r\n* El horario del área de abasto es de 7:00 a 15:00, lunes a viernes.\r\n* En el mes de febrero 2014 hubo cambio de administración.\r\n* Hay 11 unidades que son gerencias: Cd. Morelos, Estación Coahuila, Guadalupe Victoria, Reacomodo, Nuevo León, Sta. Isabel, Hidalgo, Orizaba, Industrial, González Ortega y San Felipe. Las gerencias tienen a su cargo unidades menores; pueden redistribuir medicamento, tienen instalaciones de mayor capacidad y realizan tareas de supervisión. Las gerencias de Cd. Morelos, Gpe. Victoria y San Felipe son también CAAPS.\r\n* Hay 11 caravanas de Oportunidades que recogen sus paquetes directamente en el almacén.\r\n* Hay dos unidades cerradas: UNEME Santorales y Ejido Guerrero.\r\n* Maneja 4 catálogos:\r\n            + Centros de salud  normal: 155 claves\r\n            + CAAPS normal: 292\r\n            + Especial por paciente CAAPS y CS: 34. \r\n            + Material de Curación General: 124\r\n* Hay un calendario mensual de entregas a las unidades que contempla once rutas. Se necesita tener completo el pedido de toda la ruta para autorizar el surtido. \r\n* Depto. Abasto recibe pedidos de unidades, valida y envía pedidos definitivos a almacén para que reparta. Necesita que Almacén genere la orden de envío para poder verlo en sistema y llevar control de lo que se va a surtir en cada unidad. Conforme a esta información genera un reporte de porcentaje de surtido que presenta a la Administración. La JS no cuenta con recursos para hacer compras directas.\r\n* El departamento de abasto cuenta con un camión de 3.5 ton modelo 2011 con thermoking que fue modificado con una caja más grande lo que lo dañó y lleva más de un año parado. Hay otros equipo que comparten con la JS que usan para repartir.\r\n* La mayoría de las unidades no cuentan con responsable de Farmacia. Deberían de entregar inventarios semanales pero no se les exige porque se sabe que no tienen el personal para esta tarea. El propio Depto. Abasto sólo cuenta con una persona para realizar análisis, supervisión, distribución extemporánea y elaboración de reportes.\r\n* Las unidades deberían usan el sistema E-SIAP (Sistema Informático de Atención Primaria) que está diseñado para controlar pedidos, inventarios, captura de recetas, dispensación, expediente electrónico y múltiples reportes (ej. SUIVE) pero apenas se está implementando y se usa con diferentes niveles de acceso en cada unidad. Continúa con modificaciones; mientras tanto siguen usando tarjetas de almacén. Abasto y Almacén usan otro software: Sistema de Almacenes (Java 6).\r\n* Los medicamentos de poca rotación sólo se asignan cuando hay pacientes específicos que los requieren; otros de poco uso (ej. faboterápicos) se envían a gerencia para que los distribuye según sea necesario. Insulina y planificación familiar son manejados por programas. El pedido de dental lo valida la Dra. Nancy Guerra por lo que el responsable de abasto sólo reenvía la información. El único medicamento agotado desde enero 2014 es la pravastatina.\r\n* Los caducados se reportan a oficina central y se espera a que se autorice su destrucción. En por lo menos dos años no habido una.\r\n* Las unidades atienden de 7:00 a 15:00 de lunes a viernes.'), ('2', 'J.S. 2 TIJUANA', 'Director Dr Hector Zepeda se encontraba en reunión por lo que nos atendió la Directora CP Maria de los Angeles Ochoa dándonos un breve recorrido por las oficinas de dicha Jurisdicción Sanitaria.\r\n\r\nNos comentaron que ellos como autoridad Jurisdiccional no tienen ingerencia alguna sobre el almacén ubicado en Tijuana, que este lo tripulan desde Mexicali y es un tema crítico ya que el % de abasto es bajo y a los únicos que les pueden exigir es a Recursos Materiales Mexicali, más no al almacén, de ser así tendrían varias ventajas, como solicitarles a ellos insumo de urgencia, modificación de calendario, eventualidades, etc.\r\n\r\nTienen un pequeño lugar en donde almacenan insumo debido a que de ahí despachan a las caravanas de salud, el almacén les surte de manera mensual en base a requerimiento y de ahi se los da la Dra Gladys para que vayan a hacer su recorrido correspondiente.\r\n\r\nSe pone a nuestras ordenes y nos facilito a una persona de mantenimiento para que nos llevara a Centros de Salud cercanos y al propio Almacén Jurisdiccional.'), ('3', 'J.S. 3 ENSENADA', 'Me presente con el Jefe jurisdiccional Dr. Hector Adrian Trejo Dozal, quien dio la orden a su personal de que me facilitaran toda la información necesaria. De ahí le solicito al personal que informara al personal del almacén para que me brindaran la información que necesitara. Así mimso se le pregunto al doctor si quería que se realizara el censo en alguna unidad en especial, a lo cual solicito que se hiciera en la unidad Colonia Popular 89. Terminado esto se continuo a visitar la unidad solicitada y las instalaciones del almacén.'), ('4', 'J.S. 4 VICENTE GUERRERO', 'Nos entrevistamos con Victor Manuel Guevara Ventura, (Encargado de recursos materiales y Coordinador de servicios generales). Se le informo del censo que se está haciendo y que el fin de este era para ver el estatus de las unidades en relación al abasto y de como es que se realiza en la Jurisdicción 4 \"Vicente Guerrero\". Nos informo que el jefe jurisdiccional no se encuentra debido a que salio a una reunión. El nombre de la jefa jurisdiccional es Dra. María Del Consuelo Monroy Ibarra.\r\nNos explico como llevan a cabo el abasto de las unidades, así como también como realizan los requerimientos al almacén de Ensenada, ya que ellos no solicitan el insumo al almacén estatal. Todo lo ven a través del almacén de Ensenada.');
COMMIT;

