BEGIN;
INSERT INTO `tb_f` VALUES ('1026', 'LOS MEDICAMENTOS DE PRIMER NIVEL SE SURTE SEGUIDO, EL MEDICAMENTO DE SEGUNDO NIVEL  NO SE SURTEN CON FRECUENCIA, Y SON SOLICITADOS REGULARMENTE, NO SE CUENTA CON SEMAFORIZACION EN LA UNIDAD NI CON ETIQUETAS DE IDENTIFICACIÓN , EL MEDICAMENTO SE ENCUENTRA ACOMODADO POR CLAVE,  CUENTAN CON MEDICAMENTO CADUCO, EL ÁREA DE ALMACÉN SE UTILIZA COMO COMEDOR, NO CUENTA CON ALGÚN PROGRAMA PARA LA DISPENSACIÓN DE MEDICAMENTO'), ('1027', 'EN EL ÁREA ASIGNADA PARA FARMACIA ES TAMBIÉN COMEDOR Y BAÑO, EL MEDICAMENTO ES DISPENSADO POR TODO EL PERSONAL DE LA UNIDAD, NO SE CUENTA CON ALMACÉN EN LA FARMACIA SE ASIGNA UNA ÁREA PARA EL INSUMO EJEMPLO ARRIBA DE LOS ESTANTES, NO SE REALIZA AUN CAPTURA DE RECETAS, MANIFIESTA LA ADMINISTRADORA QUE POR LO REGULAR CUANDO LES TOCA LA VISITA DE ABASTO NO SIEMPRE ALCANZAN QUE LES SURTAN EL TOTAL DE LAS CLAVES REQUERIDAS Y  SE TIENE QUE SOLICITAR EL APOYO A OTRAS UNIDADES DE ATENCIÓN QUE CUENTEN CON INVENTARIO DE LAS CLAVES FALTANTES, SOLO USAN UN ARCHIVO EN EXCEL PARA LLEVAR EL CONTROL DE DISPENSADO, TIENE COMPUTADORAS PERO SOLO LAS OCUPAN CON ARCHIVOS EN EXCEL'), ('1028', 'LA UNIDAD ES UN MODULO ESPECÍFICAMENTE DE AYUDA AL MIGRANTE, EN CUAL APOYA A LAS PERSONAS EN CASO DE QUE LO REQUIERAN CON MEDICAMENTO VÍA PASTILLEO, YA QUE NO EXPIDE RECETAS POR QUE LAS PERSONAS QUE LLEGAN SON PERSONAS INMIGRANTES, PERSONAS EN SITUACIÓN DE CALLE QUE NO CUENTAN CON MEDICAMENTO SUFICIENTE PARA TRATAR A LA GENTE Y EL MEDICO RESPONSABLE TIENE QUE IR POR SU MEDICAMENTO A LA JURIS NO LE ENVÍAN MEDICAMENTO,LA DOTACIÓN DE MEDICAMENTO NO ES LA OPTIMA Y ES LO QUE MAS REQUIERE LA UNIDAD. LA CONSULTA ACTUALMENTE ES POCA!! '), ('1030', 'EN LA UNIDAD NO SE CUENTA CON ÁREA DE ALMACÉN, EL INSUMO CON EL QUE SE CUENTA TODO ESTA RESGUARDADO EN LA FARMACIA, EL INVENTARIO SE REALIZA UNA VEZ Y DE AHÍ SE SACA UNA RELACIÓN PARA SU PEDIDO. EL MEDICAMENTO SE ENCUENTRA ACOMODADO POR ORDEN DE CLAVE Y ALGUNOS CUENTAN CON ETIQUETA DE CLAVE, NO SE CUENTA CON SEMAFORIZACION, LAS CLAVES DE PF SE RESGUARDAN EN FARMACIA PERO SON SURTIDAS POR EL MISMO PROGRAMA, EL MEDICAMENTO DE SEGUNDO NIVEL SE ABASTECE ÚNICAMENTE BAJO REFERENCIA MEDICA, CUANDO NO SE CUENTA CON INSUMO EN LA UNIDAD SE REALIZAN TRASPASOS EN LAS UNIDADES CERCANAS EN CLAVES QUE PUDIERAN OCUPAR COMO URGENTE, NO CUENTA CON ALGÚN PROGRAMA DE RECETA ELECTRÓNICA SOLO UN EXCEL PARA LLEVAR UN CONTROL DE SOLICITADO CONTRA SURTIDO .'), ('1031', 'LA UNIDAD CUENTA CON UN ESPACIO DE ALMACÉN MUY PEQUEÑO, SE CUENTA CON MUCHO INSUMO CADUCADO QUE NO SE HA RETIRADO DE LA UNIDAD, EL SISTEMA DE CAPTURA DE RECETA NO SE LLEVA AL MOMENTO, NO SE CUENTA CON UN SISTEMA DE INVENTARIO AL DÍA NI EN ELECTRÓNICO , EL SISTEMA DE RECTA IMPLEMENTADO NO LO UTILIZAN, NO SE CUENTA CON CONTROLES DE SEMAFORIZACION, TAMBIÉN USAN UN SISTEMA DE CAPTURA DE RECETAS EL CUAL NO TIENE INVENTARIO DEL INSUMO SOLO CAPTURA INFORMACIÓN DE RECETADO Y AGREGAR DATOS DEL PACIENTE, DESDE HACE VARIOS MESES NO LLEGA MEDICAMENTO DE ESPECIALIDAD.'), ('1034', 'LLEVAN DOS MESES SIN RECIBIR SULFATO FERROSO. EL EXPEDIENTE ELECTRÓNICO ARROJA RECETA PERO NO CUADRA  CON EL INVENTARIO PORQUE NO HAY QUIÉN CAPTURE LA INFORMACIÓN. DOBLE TRABAJO AL HACER A MANO Y LUEGO PASAR LA INFORMACIÓN A LA COMPUTADORA. PIENSAN QUE EL SISTEMA ES BUENO Y FUNCIONA, PERO NO HAY CAPACTIACIÓN Y NO SE APROVECHA AL 100%. USAN EL SISTEMA ELECT&#341;ONICO SIAP VERSIÓN 3.2 DESDE 2012 (DESARROLLADO POR AUREN, EMPRESA ESPAÑOLA). OFICINAS CENTRALES SIGUEN TRABAJANDO COMO ANTES Y NO APROVECHAN SISTEMAS. LA SECRETARÍA SIGUE ENTREGANDO RECETAS FOLIADAS POR SI NO HUBIERA SISTEMA (YA CASI NO SE USAN). HAY DOS PERSONAS EN LA JURISDICCIÓN PARA DAR MANTENIMIENTO A TODAS LAS COMPUTADORAS. COMPARTEN LUZ Y AGUA CON EL CAPASITS UBICADO AL LADO.'), ('1035', 'NO HAY ALMACÉN JURISDICCIONAL POR LO QUE LES SURTE EL ALMACÉN ESTATAL. PROBLEMAS CON ACCESO A INTERNET AÚN CUANDO SÍ HAY CONEXIÓN. POR EL VOLUMEN DE INVENTARIO QUE TIENEN LES LLEGAN DE OTRAS ZONAS A PEDIR MEDICAMENTOS. SE PRESTAN MEDICAMENTOS ENTRE CENTROS DE SALUD, ESTO CONTROLADO POR EL COORDINADOR. SÍ MANEJAN SEMAFORIZACIÓN. NO HAY LUGAR A DÓNDE LLEVARSE MEDICAMENTOS CADUCOS. CERTIFICADOS DOS VECES POR COFEPRIS (SEGUNDA VEZ POR ANTIBIÓTICOS). LLEVA REGISTRO DE ANTIBIÓTICOS A MANO. USAN SELLO PARA DISPENSAR ANTIBIÓTICOS. NUNCA LOS HA VISITADO COFEPRIS. CAPTURAN LAS RECETAS DIARIAMENTE EN EL E-SIAP. LA ENCARGADA DE FARMACIA TRABAJA SIETE HORAS (8:00 A 15:00) Y SU ASISTENTE DE 14:00 A 20:30 HRS. SIAP: SISTEMA DE ATENCIÓN E INFORMACIÓN AL PACIENTE. SISTEMA SIAP BASADO EN JAVA, CADA USUARIO SÓLO TIENE ACCESO A SUS MÓDULOS RELEVANTES. EL ALMACÉN DE MATERIAL DE CURACIÓN ESTÁ UBICADO EN EL ÁREA DE CURACIONES.'), ('1040', 'FARMACIA TRABAJA LOS SIETE DÍAS DE LA SEMANA. REFRIGERADOR EN FARMACIA. VACUNAS TIENE SU PROPIO REFRIGERADOR. EL HOSPITAL TIENE PLANTA DE LUZ QUE CUBRE URGENCIAS. EL REFRIGERADOR NO ESTÁ CONECTADO A LA PLANTA. EL PROCEDIMIENTO PARA CADUCOS ES HACER UNA ACTA FIRMADA POR DIRECTOR Y RESPONSABLE DE FARMACIA QUE SE ENVÍA A JURISDICCIÓN. LA ÚLTIMA VISITA DE RECOLECCIÓN DE CADUCOS FUE HACE DOS AÑOS.'), ('1041', 'ES GERENCIA Y TIENE 5 UNIDADES A SU CARGO: BENITO JUÁREZ, ALGODONES, EJIDO COLIMA, EJIDO JANITZIO Y EJIDO HERMOSILLO. LA GERENCIA APOYA CON TRASPASOS A SUS UNIDADES. EL ADMINISTRADOR DE LA UNIDAD RECOLECTA PEDIDOS DE TODAS LAS UNIDADES A SU CARGO Y ENVÍA A LA JURISDICCIÓN. LA JS NO SURTE A MENOS QUE RECIBA EL PEDIDO DE TODAS LAS UNIDADES DEPENDIENTES DE LA GERENCIA. HAY UN RESPONSABLE PARA CADA UNA DE LAS ÁREAS: MEDICAMENTOS, MATERIAL DE CURACIÓN Y DENTAL (POR LLEVAR MEJOR CONTROL INTERNO). FARMACIA CUENTA CON ALMACÉN DE MEDICAMENTO Y HAY POR SEPARADO UN ALMACÉN DE CURACIÓN QUE ES MANEJADO POR OTRA PERSONA. MANEJAN INVENTARIOS POR KARDEX Y POSTERIORMENTE CAPTURAN TODO AL SIAP. ESTA INFORMACIÓN ES ENVIADA SEMANALMENTE A LA JS. POR FALTA DE PERSONAL YA NO REALIZAN CIRUGÍAS NI ATENCIÓN DE PARTOS. NO SE PUDO REALIZAR INVENTARIO PORQUE YA SE IBA EL ENCARGADO.'), ('1042', 'LA UNIDAD SÍ TIENE LETRERO PERO ESTÁ TAPADO POR UNA LONA. LA UNIDAD ES UNA GERENCIA QUE SUPERVISA Y REALIZA EL PEDIDO DEL CENTRO DE SALUD PÁTZCUARO (ESTE CS SE SURTE DIRECTAMENTE DE AQUÍ). CONTROL SEPARADO DE MEDICAMENTOS, CURACIÓN Y DENTAL. DOS ENFERMERAS Y EL DIRECTOR DE LA UNIDAD CONTROLAN EL ALMACÉN DE MATERIAL DE CURACIÓN. EL ÁREA DE FARMACIA CUENTA CON UN ALMACÉN INDEPENDIENTE AL DE CURACIÓN. LA FARMACIA RESGUARDA LA INSULINA DE VARIAS UNIDADES CERCANAS. EL PEDIDO DE MATERIAL DE CURACIÓN, MEDICAMENTO Y DENTAL SE HACE MENSUALMENTE. JS ENTREGA JUNTO MEDICAMENTOS, CURACIÓN Y DENTAL. EL ALMACÉN DE MATERIAL DE CURACIÓN OPERA 24 HORAS. HAY MATERIAL DE CURACIÓN EN TRES LUGARES: ALMACÉN, CEYE Y SUB-CEYE (ESTÉRIL). COMO NO SE ENCONTRABA EL RESPONSABLE DE LA UNIDAD NO SE NOS PERMITIÓ TOMAR FOTOGRAFÍAS DE MATERIAL DE CURACIÓN NI HACER INVENTARIO.'), ('2004', ''), ('2016', ''), ('2032', 'NOS ATENDIÓ EL ADMINISTRADOR DE LA UNIDAD, HAY DESABASTO EN LA UNIDAD, NO TIENE SISTEMA DE CAPTURA DE RECETA NI EN LOS CONSULTORIOS DE LOS MÉDICOS, NO EXISTE UN ÁREA COMO TAL DE ALMACÉN, TIENE HABILITADO UN ESPACIO QUE FUNGÍA COMO CONSULTORIO'), ('2035', 'NOS ATENDÍÓ LA LIC. MARTHA VERÓNICA LÓPEZ RAMÍREZ, COMENTA QUE HACE FALTA TENER UNA MEJOR COMUNICACIÓN CON EL ALMACÉN QUE LES SURTE EL INSUMO MÉDICO, NO EXISTE COMO TAL UNA FARMACIA Y NO HAY UN SISTEMA DE CAPTURA DE RECETAS, EN RELACIÓN AL INSUMO POR CADUCAR, SE LE REPORTA AL ALMACÉN JURSIDICCIONAL PARA DESPLAZARLO Y/O DESTRUIRLO.'), ('2037', 'NOS ATENDÍO EL DIRECTOR DE LA UNIDAD, EL DR. KIM EL CUAL MANIFIESTA QUE ESTÁ INTERESADO EN TENER UN PROVEEDOR EXTERNO, YA QUE EL ALMACÉN PASA DE FORMA IRREGULAR  Y EL ABASTO MUCHAS DE LAS OCASIONES VIENE INCOMPLETO, NO TIENEN SISTEMA DE CAPTURA DE RECETAS NI EN LOS CONSULTORIOS.'), ('2039', 'EL ACCESO AL CSU ES PAVIMENTADO Y SIN PROBLEMAS. NOS ATENDIÓ LA ADMINISTRADORA LIC. IRENE PALACIOS JUNTO CON JOSÉ CARLOS CORTÉS QUIEN ES EL ENCARGADO DE FARMACIA, QUIENES ARGUMENTAN QUE EXISTE UN DESCONTROL EN EL ALMACÉN JURISDICCIONAL YA QUE NO LES LLEGA DE ACUERDO A NECESIDADES. LOS MÉDICOS MANEJAN UN SISTEMA LLAMADO SIAP (SISTEMA DE INFORMACIÓN AL PACIENTE), PERO ÉSTE NO TIENE COMUNICACIÓN CON EL INVENTARIO DE LA FARMACIA, ES DECIR, SE REALIZA LA RECETA PERO NO HACE LA DISMINUCIÓN CORRESPONDIENTE AL MISMO, EN FARMACIA TIENEN EL MÓDULO DE DISPENSACIÓN DE INSUMOS MÉDICOS, HACEN LA CAPTURA DE LA RECETA PERO EL SISTEMA NO HACE LA DISMINUCIÓN DEL INSUMO, AL PREGUNTARLES POR QUE LO CAPTURAN, NOS RESPONDEN \"POR INSTRUCCIONES DEL PERSONAL DEL SSBC\", EL SISTEMA ES WEB, PERO TIENEN UNA SERVICIO MUY DEFICIENTE DE INTERNET POR LO QUE ES INTERMITENTE EN SU FUNCIONAMIENTO; NO ARROJA NINGÚN REPORTE'), ('2040', 'NOS ATENDIÓ ENFERMERA HILDA NOPAL PEREZ COMENTANDO QUE LLEGAN MUCHOS DERECHO-HABIENTES DE OTROS CENTROS DE SALUD A SURTIR LA RECETA, SIN EMBARGO NO CUENTAN CON EL ABASTO SUFICIENTE POR LO QUE DERECHO-HABIENTES SE VAN INCONFORMES. ACTUALMENTE EL ÁREA DE FARMACIA SOLO DA SERVICIO HASTA MEDIO DÍA DEBIDO A QUE UNAS DE LAS DESPACHADORES ESTA DE VACACIONES, MISMO CASO PARA EL ÁREA DE ALMACÉN, AUNQUE ESTE SI ESTA CERRADO POR QUE SOLO HAY UNA PERSONA. EL MATERIAL DE CURACIÓN LO ADMINISTRA ENFERMERAS. SE MANEJA EL EXPEDIENTE ELECTRÓNICO Y HASTA AHORITA NO HAN TENIDO NINGÚN PROBLEMA.'), ('2041', 'EL CAMINO PARA LLEGAR AL CENTRO DE SALUD ESTA TODO PAVIMENTADO, NOS ATENDIÓ LA ADMINISTRADORA DE LA UNIDAD LIC. JAZMÍN GARCÍA SÁNCHEZ ASÍ COMO TAMBIÉN LA DIRECTORA LA DRA. PAOLA HERRERA TOVAR, MENCIONAN QUE TIENEN UN 70% DE ABASTO, LO QUE LES LLEGA DEL ALMACÉN DE TIJUANA NO LES ES SUFICIENTE EN BASE A LOS CONSUMOS QUE TIENEN, NO CUENTAN CON SISTEMA INFORMÁTICO, ANTES LO TENÍAN, PERO AL TENER UNA SEÑAL DE INTERNET INTERMITENTE OPTARON POR REGRESAR A LA FORMA MANUAL.'), ('2043', 'LA UBICACIÓN DEL CENTRO AVANZADO DE ATENCIÓN PRIMARIA A LA SALUD ES ADECUADA Y SIN NOVEDADES AL LLEGAR.  NO SE ENCONTRABA EL DIRECTOR POR LO QUE NOS ATENDIÓ LA ENCARGADA DE CAJA Y RECEPCIÓN, AL IGUAL QUE ENFERMERAS EN TURNO. EN UN PEQUEÑO ESPACIO RESGUARDAN EL MEDICAMENTO Y LAS PROPIAS ENFERMERAS Y DOCTORES SURTEN LO REQUERIDO A LOS SERVICIOS, Y EL MATERIAL DE CURACIÓN LO TIENEN EN URGENCIAS ADULTOS.  CUENTAN CON SEIS CAMAS CENSABLES Y UNA NO CENSABLE.'), ('3002', 'PARA LLEGAR ES SOBRE LA CARRETERA PRINCIPAL LLEGANDO PFP HACIA LA IZQUIERDA POR UN CAMINO DE TERRACERIA A 300 MTS APROX, FALTA INTERNET PARA PODER COMUNICARSE CON LA JURIS, ES PRÁCTICAMENTE NUEVO, Y ESTA EN BUENAS CONDICIONES EL MEDICAMENTO LES LLEGA EN TIEMPO Y FORMA NO TODO PERO LA MAYORIA DE LO REQUERIDO LES LLEGA CADA 15 DIAS'), ('3004', 'NO LLEGA TODO EL MEDICAMENTO, HACE FALTA INSUMO PARA PACIENTES CRÓNICOS, NOS COMENTA LA ENFERMERA ENCARGADA QUE EL METODO EN EL CUAL SURTEN LA FARMACIA ES QUINCENAL, LLEGA UN CAMIÓN Y SURTE SOLO LO QUE PIDE EL DOCTOR ENCARGADO, NOS COMENTAN QUE PARA QUE SURTAN EL MATERIAL DE CURACIÓN, LAS ENFERMERAS TIENEN QUE IR A RECOGERLO A LA JURISDICCIÓN. EL MODULO ES NUEVO PRACTICAMENTE '), ('3006', 'POR LA CARRETERA PRINCIPAL ANTES DE LLEGAR AL HOTEL  DEL RANCHO LOS PINOS EN DIRECCION A ENSENADA, HACIA LA IZQUIERDA ENTRANDO POR LA CARRETERA DE TERRACERIA Y PASANDO LA ZONA HABITACIONAL SE ENCUENTRA UN LUGAR LLAMADA CASITAS ES DONDE ESTA LA UNIDAD DE SALUD, LA INFORMACION OBTENIDA PARA ESTE CENSO FUE PROPORCIONADA POR LA SEÑORA ENCARGADA DE ABRIR EL CENTRO DE SALUD QUE ES DONDE LLEGA LA CARAVANA MARIA ISABEL MARTINEZ LARA, TAMBIEN NOS COMENTA QUE EL DOCTOR LLEGA A DAR CONSULTA LOS DIAS MARTES Y JUEVES DE 7:00 A 13:00,  HAY UNA CONSTRUCCION RECIEN TERMINADA Y TODAVIA NO ESTA DADA DE ALTA LA UNIDAD'), ('3012', 'EL CAMINO ESTA EN BUENAS CONDICIONES PARA LLEGAR Y SE ENCUENTRA EN EL CENTRO DE LA COMUNIDAD Y SOBRE LA CARRETERA PRINCIPAL LOS COMENTARIOS  SON: FALTA MEDICAMENTO NO TIENEN TODAS CLAVE, FALTA MEDICAMENTO PARA CRÓNICOS HIPERTENSOS, FALTA INTERNET, NO TIENE MEDICO DE CONTRATO, SON 4 HORAS DE CAMINO DESDE BAHÍA DE ÁNGELES, NO CUENTA CON VITRINAS, NO CUENTAN CON CARRO ROJO Y REFRIGERADOR PARA RED FRÍA.'), ('3013', 'Se tienen dos laptop adicionales a la computadora que son del personal que labora (1 del médico y otra del enfermero).'), ('3015', 'No hay médicos de base y los 2 pasantes no tienen más de 4 meses que se incorporaron a la unidad y desde ese tiempo solo los han visitado 1 vez para traerles medicamento. No tienen ningún inventario, éste lo tiene la jurisdicción.'), ('3017', ' NO TIENE TELEFONÍA CELULAR, SOLO SATÉLITE, TIENE PROBLEMAS POR LA DISTANCIA EN LA DISPENSACIÓN DE MEDICAMENTO YA QUE ES LA UNIDAD MAS ALEJADA,  TAMBIÉN DA ATENCIÓN A LAS COMUNIDADES ALEJADAS COMO POR EJEMPLO LA GRINGA, LAS ANIMAS, SAN BORJA, EL PARADOR DE BAHÍA, LE FALTA EQUIPO DE SILLAS DE RUEDAS, MULETAS ETC. Y FALTA ESTANTERÍA. FALTA ENFERMERA.   LAS COMUNIDADES SON MUY ALEJADAS ASI QUE LE TIENEN QUE HABLAR POR TELEFONO PARTICULAR A LA DOCTORA PARA HACER CITA, 012001249111 ES EL TELEFONO DE LA DELEGACION DE BAHIA PARA COMUNICARSE CON LA DOCTORA CLAUDIA'), ('3018', 'El equipo de cómputo es propiedad del Responsable de la Unidad. La unidad trabaja de Lunes a Jueves y Sábado y Domingo solo atiende urgencias. Y se maneja más como un puesto de socorro que como unidad de atención.'), ('3020', 'LA UNIDAD SE ENCUENTRA EN SOBRE LA CARRETERA DIRECCIÓN A ENSENADA EN LA COMUNIDAD LA PROVIDENCIA, HACIA LA IZQUIERDA, SOBRE LA CALLE DE TERRACERIA, EL NIVEL DE ABASTO ES DE 80% POCA CARENCIA DE MEDICAMENTO. OCUPAN UN PROGRAMA QUE SE LLAMA SINOS 2.0 DONDE LLEVAN EL CONTROL DE SEGURO POPULAR Y OPORTUNIDADES EN ALGUNAS DE LAS UNIDADES NO TODAS, TIENEN MEDICAMENTO CADUCADO O POR CADUCAR POR EJEMPLO CLAVE 101'), ('3021', 'La Unidad la surten desde la Unidad Sánchez Taboada (maneadero). La unidad cuenta con planta generadora de luz.'), ('3030', 'El nombre de la unidad se cayó y ya no sé lo volvieron a poner.'), ('3036', 'La Unidad cuenta con planta de generación de luz, cuentan con 2 farmacias una para 24 horas en el área de hospitalización y la otra con un horario de 8:00 a 15:30 para consulta externa. Para el área de hospitalización manejan medicamentos controlados. Debido a que tiene el servicio de hospitalización el horario de atención es de 24 horas pero el horario de consulta externa es de 08:00 a 15:30. La farmacia cerró debido a que el personal fue a una reunión sindical, ocasionando que el paciente no obtuviera el medicamento recetado por el médico.'), ('3037', 'La farmacia atiende también al personal del C.S. y las instalaciones son las mismas.'), ('3999', 'EL MEDICO EXPIDE LA RECETA Y LAS ENFERMERAS SURTEN, FALTA MEDICAMENTO BÁSICO Y PARA DIABETICOS HIPERTENSOS,  LOS ESPACIOS DE ATENCIÓN SON MUY PEQUEÑOS, NECESITAN RED FRÍA, COMPUTADORA, ANAQUELES. PRINCIPALMENTE NECESITAN MEDICAMENTO DE CUADRO BÁSICO, PARA EL MATERIAL DE  CURACIÓN EL PERSONAL TIENE QUE IR A LA JURISDICCIÓN POR EL MATERIAL Y DEMORAN PARA TRAER EL MATERIAL EN CASO DE QUE LO TRAIGAN. LA LOGÍSTICA DE LA JURISDICCIÓN DEBE CAMBIAR PARA QUE LOS TRABAJADORES DE LOS CENTROS PUEDAN HACER SU TRABAJO. '), ('4001', 'SOBRE LA CARRETERA PENINSULAR DIRECCIÓN ENSENADA LLEGANDO A VICENTE GUERRERO EN LA CALLE DEL BANAMEX  250MST SE ENCUENTRA EL CENTRO DE SALUD , AQUÍ SE UTILIZA UN PROGRAMA PARA LA RECETA, LA UNIDAD ESTA CATALOGADA COMO CAPS, SIEMPRE HAY DES ABASTO DE MEDICAMENTOS PARA DIABETICOS-HIPERTENSOS, EL MEDICAMENTO DE CUADRO BÁSICO TAMBIÉN FALTA, Y LOS ENCARGADOS DEL ALMACÉN Y FARMACIA HACEN EL REQUERIMIENTO CUANDO VIENEN LOS DEL ALMACÉN GENERAL DE SECRETARIA, TAMBIÉN FALTA PERSONAL ES INSUFICIENTE, NECESITA MAS ESPACIO Y LUGAR DE TRABAJO, TAMBIÉN NOS COMENTAN QUE EN ROPA, Y SABANAS PARA CIRUGÍA ESTÁN EN DES ABASTO, EL PERSONAL DE ALMACÉN SURTE A LA FARMACIA CON UN FORMATO DE PEDIDO.'), ('4002', 'LA UNIDAD SE ENCUENTRA EN LA CALLE DONDE SE ENCUENTRA EL BANCO HSBC EN UNA CALLE DE TERRACERIA, EN LA UNIDAD NOS ENCONTRAMOS CON MEDICAMENTO CADUCADO, SE ENCUENTRA MEDICAMENTO EN CAJAS DE CARTON, NOS COMENTAN QUE LOS ABASTOS LLEGAN CADA 15 DIAS PERO NO LLEGA TODO EL MEDICAMENTO, Y FALTA MUCHO MEDICAMENTO PARA DIABETICOS-HIPERTENSOS, LA UNIDAD ES AMPLIA EN FARMACIA, CUENTA CON UN REFRIGERADOR DOMESTICO PARA RED FRIA');
COMMIT;

